CREATE DEFINER=`root`@`localhost` PROCEDURE `get_result`()
BEGIN
	SELECT 	position.pos_id,
		position.pos_name,
		UPPER(account.acct_lname) AS acct_lname,
		UPPER(account.acct_fname) AS acct_fname,
